import React from "react";
import Layout from "../components/Layout";

const propTypes = {};

const defaultProps = {};

export default function index() {
  return (
    <Layout>
      <section className="flex vh-100 w-100">
        <aside className="title">
          <h1>Agenda</h1>
        </aside>
        <div className="grow w-100 flex col">
          <div className="min-h5 item1">agenda item</div>
          <div className="min-h5 tc item2">+ add item</div>
        </div>
      </section>
      <style jsx>
        {`
          .item1 {
            background-color: #fdfce7;
          }
          .item2 {
            background-color: #faf4c0;
          }

          .grow {
            flex-grow: 1;
          }

          .title {
            writing-mode: vertical-rl;
            transform: rotate(180deg);
            text-align: center;
            font-size: 4rem;
            text-transform: uppercase;
            padding: 0 20px;

            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 23px;
            font-style: normal;
            font-variant: normal;
            font-weight: 700;
            line-height: 23px;
            color: #363d87;
          }
        `}
      </style>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
